class Solution(object):
    def removeInvalidParentheses(self, s):
        """
        :type s: str
        :rtype: List[str]
        """

        # 1. find the left and right parentheses
        # 2. remove the left and right parentheses
        # 3. find the valid parentheses
        # 4. remove the invalid parentheses
        # 5. repeat 2 and 3 until the left and right parentheses are removed
        # 6. return the valid parentheses

        # 1. find the left and right parentheses
        left_count = 0
        right_count = 0
        for i in range(len(s)):
            if s[i] == '(':
                left_count += 1
            elif s[i] == ')':
                if left_count > 0:
                    left_count -= 1
                else:
                    right_count += 1

        # 2. remove the left and right parentheses
        s = s.replace('()', '')

        # 3. find the valid parentheses
        valid_parentheses = []
        for i in range(len(s)):
            if s[i] == '(':
                left_count -= 1
            elif s[i] == ')':
                right_count -= 1
            if left_count == 0 and right_count == 0:
                valid_parentheses.append(s[:i+1] + s[i+1:])

        # 4. remove the invalid parentheses
        for i in range(len(valid_parentheses)):
            valid_parentheses[i] = valid_parentheses[i].replace('()', '')

        # 5. repeat 2 and 3 until the left and right parentheses are removed
        while left_count > 0 or right_count > 0:
            new_valid_parentheses = []
            for i in range(len(valid_parentheses)):
                for j in range(len(valid_parentheses[i])):
                    if valid_parentheses[i][j] == '(':
                        new_valid_parentheses.append(valid_parentheses[i][:j] + valid_parentheses[i][j+1:])
