    def wordPattern(self, pattern, s):
        """
        :type pattern: str
        :type s: str
        :rtype: bool
        """

        # split the string into words
        words = s.split()

        # check if the length of pattern and words are equal
        if len(pattern) != len(words):
            return False

        # create a dictionary to store the mapping
        mapping = {}

        # iterate over the pattern and words
        for i in range(len(pattern)):
            # check if the pattern and word are already mapped
            if pattern[i] in mapping:
                # check if the pattern and word are mapped to the same word
                if mapping[pattern[i]] != words[i]:
                    return False
            # check if the pattern and word are not already mapped
            else:
                # check if the word is already mapped to a different pattern
                if words[i] in mapping.values():
                    return False
                # map the pattern and word
                mapping[pattern[i]] = words[i]

        # all words are mapped to a pattern
        return True

