class Solution(object):
    def findComplement(self, num):
        """
        :type num: int
        :rtype: int
        """

        ## 1. convert to binary
        ## 2. flip the bits
        ## 3. convert back to decimal

        ## 1. convert to binary
        binary = bin(num)[2:]

        ## 2. flip the bits
        flip_binary = ""
        for bit in binary:
            if bit == "0":
                flip_binary += "1"
            else:
                flip_binary += "0"

        ## 3. convert back to decimal
        return int(flip_binary, 2)

