class Solution(object):
    def numberOfArithmeticSlices(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        if len(nums) < 3:
            return 0

        count = 0
        diff = nums[1] - nums[0]
        for i in range(2, len(nums)):
            if nums[i] - nums[i-1] == diff:
                count += 1
            else:
                diff = nums[i] - nums[i-1]

        return count

