class Solution(object):
    def findAllConcatenatedWordsInADict(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """

        # build a dict
        word_dict = {}
        for word in words:
            word_dict[word] = 1

        # build a list of concatenated words
        res = []
        for word in words:
            if self.isConcatenated(word, word_dict):
                res.append(word)

        return res

    def isConcatenated(self, word, word_dict):
        # base case
        if word in word_dict:
            return True

        # recursive case
        for i in range(1, len(word)):
            left = word[:i]
            right = word[i:]
            if left in word_dict and right in word_dict:
                return True

        return False

