    def totalNQueens(self, n):
        """
        :type n: int
        :rtype: int
        """

        def backtrack(row, cols, diag1, diag2):
            if row == n:
                return 1

            count = 0
            for col in range(n):
                if col not in cols and row + col not in diag1 and row - col not in diag2:
                    count += backtrack(row + 1, cols + [col], diag1 + [row + col], diag2 + [row - col])
            return count

        return backtrack(0, [], [], [])

